uint64 utility_allocate_system_resources(longlong utility_resource_primary_handle)
{
  uint64 utility_result;
  int *utility_result_pointer[utility_security_token_offset];
  uint32 *UTILITY_GENERIC_DATA_POINTER;
  uint utility_status_value;
  ulonglong utility_state;
  utility_result = system_memory_operation(*(uint32 *)(utility_resource_primary_handle + utility_data_offset),&utility_system_resource_handle);
  if ((int)utility_result == UTILITY_ZERO) {
    utility_state = UTILITY_ZERO;
    utility_state = utility_system_resource_handle - UTILITY_SIZE_OFFSET_extended_byte;
    if (utility_system_resource_handle == UTILITY_ZERO) {
      utility_state = utility_state;
    }
    UTILITY_GENERIC_DATA_POINTER = (uint32 *)(utility_resource_primary_handle + utility_data_ptr_offset + (longlong)*(int *)(utility_resource_primary_handle + utility_offset_resource_ptr) * utility_memory_standard_size);
    utility_result_pointer = (int *)(utility_resource_primary_handle + utility_data_ptr_offset);
    if (UTILITY_ZERO < *(int *)(utility_resource_primary_handle + utility_offset_resource_ptr)) {
      do {
        if ((*utility_result_pointer[utility_security_token_offset] != global_security_token_primary) || (utility_result_pointer[utility_security_token_offset_secondary] != global_security_token_secondary)) {
          utility_system_resource_handle = UTILITY_ZERO;
          utility_result = utility_process_resource_data(utility_state,(int *)(utility_resource_primary_handle + utility_data_ptr_offset) + (longlong)(int)utility_state * utility_size_standard,&utility_system_resource_handle)
        ;
          if ((int)utility_result != UTILITY_ZERO) {
            return utility_result;
          }
          if (*(longlong *)(utility_system_resource_handle + UTILITY_SIZE_OFFSET) == UTILITY_ZERO) {
            return utility_offset_flag;
          }
          utility_result = utility_handle_resource_operation(*(longlong *)(utility_system_resource_handle + UTILITY_SIZE_OFFSET),*UTILITY_GENERIC_DATA_POINTER,*(byte *)(utility_resource_primary_handle + utility_offset_flag)
                               );
          if ((int)utility_result != UTILITY_ZERO) {
            return utility_result;
          }
        }
        utility_status_value = (int)utility_state + UTILITY_INT_ONE;
        utility_state = (ulonglong)utility_status_value;
        UTILITY_GENERIC_DATA_POINTER = UTILITY_GENERIC_DATA_POINTER + UTILITY_INT_ONE;
        utility_result_pointer = utility_result_pointer + utility_pairs;
      } while ((int)utility_status_value < *(int *)(utility_resource_primary_handle + utility_offset_resource_ptr));
    }
    utility_result = UTILITY_ZERO;
  }
  return utility_result;
}

