uint64 utility_free_memory(void *memory_block_ptr, uint32 release_flag)
{
  if (memory_block_ptr == NULL) {
    return UTILITY_ZERO;
  }
  
  // 根据释放标志执行不同的释放策略
  if (release_flag & utility_memory_flag) {
    free(memory_block_ptr);
  }
  
  return UTILITY_ZERO;
}

